import React from 'react';
import './Nav.css';
import { Link } from 'react-router-dom';

const Nav = () => {
    return (
    <nav>
        <h3>Logo</h3>
        <ul className="nav-links">
            <li>About</li>
            <li>Api</li>
        </ul>
    </nav>
    )
}

export default Nav;
